61.body:
GET /api/storage/v1/tree/[token]/[path] Tree items in directory. Status code: 200 { "type": "tree", "content": TreeNode
} Where TreeNode can either be a directory: { "type": "dir", "name": String, "visibility": { "inherited": bool, "visibility": Visibility // public, hidden or private }
} or a file: { "type": "file", "name": String, "size": u64, "last_modified": u64, "visibility": { "inherited": bool, "visibility": Visibility, }
} For example { "type": "tree", "content": { "type": "dir", "name": ".system", "visibility": { "inherited": true, "visibility": public, }, "content": [ { "type": "file", "name": "pfp.png", "size": 1165233, "last_modified": 1688643521, "visibility": { "inherited": true, "visibility": "public", } } ] }
}

